import React, {Component} from 'react';
import {useSpring, animated} from 'react-spring'
import './MangaPanel.css';
import {animationConfig} from './constants.js'


function MangaPanel(props)  {
  return (
    <animated.div key={this.props.pageConfig} className="MangaPanel">
      <img src={this.props.pageConfig.img} draggable="false" unselectable="on"></img>
    </animated.div>
  );
}

export default MangaPanel;
